content.css:
.DVSL-suppress-default-styles {
  color: #abc;
}
.DVSL-canvas {
  /* since the visual is rendered in a transformed iframe, disable the pixelated rendering. */
  image-rendering: auto !important;
}
.DVSL-info-center,
.DVSL-info-left,
.DVSL-info-right {
  /* on Chrome this forces the info popup text to be sharper when the visual is zoomed */
  transform: perspective(1px) translateZ(0);
  pointer-events: none;
}
.chart-container {
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  min-height: 100vh;
  min-width: 100vw;
  z-index: 1;
}
.chart-container.full-container {
  height: 100vh;
}
.message-overlay,
.message-overlay-get-paid {
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  height: 100vh;
  min-width: 100vw;
  background: rgba(240, 240, 240, 0.9);
  z-index: 10;
  display: none;
}
.message-overlay-get-paid {
  text-align: center;
  white-space: nowrap;
}
.hide-overlay-btn {
  position: fixed;
  top: 0;
  right: 0;
  z-index: 3;
  padding: 5px;
  background-color: red;
}
img.action-btn {
  margin: auto;
  vertical-align: middle;
}
.message-overlay-get-paid .helper {
  display: inline-block;
  height: 100%;
  vertical-align: middle;
}
/* Info Window Content */
.zc-margin-top5 {
  margin-top: 5px !important;
}
.zc-margin-bottom1 {
  margin-bottom: 1px !important;
}
.zc-margin-bottom5 {
  margin-bottom: 5px !important;
}
.zc-margin-top-bottom6 {
  margin: 6px 0 !important;
}
.zc-margin-top-and-bottom5 {
  margin: 5px 0 !important;
}
.zc-margin-bottom10 {
  margin-bottom: 10px !important;
}
.zc-margin-bottom11 {
  margin-bottom: 11px !important;
}
.zc-margin-top-bottom20 {
  margin: 20px 0 !important;
}
.zc-margin-bottom15 {
  margin-bottom: 15px !important;
}
.zc-btn-pbi-ok {
  padding: 9px 30px !important;
  font-size: 11px !important;
}
.zc-info-window {
  padding: 0;
  box-shadow: 0 8px 20px rgba(0, 0, 0, 0.3);
  width: calc(100vw - 20px);
  max-width: 570px;
  font-size: 12px;
  color: #000;
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
  position: absolute;
  top: 36px;
  right: 12px;
  z-index: 2;
  display: none;
  font-family: 'SegoeUI';
  backface-visibility: hidden !important;
}
.zc-info-window-sm {
  max-width: 400px;
}
.zc-info-window-xs {
  max-width: 322px;
}
.zc-info-window-xs2 {
  max-width: 295px;
}
.zc-info-window-xs2.zc-trial-access {
  max-width: 299px;
}
.zc-info-window-xs3 {
  /*
        Specific for trial experience popups. Power BI width and height is 280x280 from
        'General' formatting options. In logs 'viewport' width and height are different:
        for 280x280 it is 270x251, therefore correct value is 270 - 10 (-10 is from
        elem.style.width = Math.round(width - 10))
    */
  max-width: 260px;
}
.zc-info-license-view {
  background: #333;
  color: #fff;
}
.zc-info-license-edit {
  background: #fff;
  color: #333;
}
.zc-underline {
  text-decoration: underline !important;
}
.zc-font-bold {
  font-weight: bold;
}
.zc-pull-left {
  float: left;
}
.zc-pull-right {
  float: right;
}
.zc-no-border {
  border: none !important;
}
.zc-font-red-text {
  color: #F00;
}
.zc-font-red-text p {
  color: #F00 !important;
}
.zc-info-window.zc-info-window-visible {
  display: block;
}
.zc-info-window * {
  -webkit-box-sizing: inherit;
  -moz-box-sizing: inherit;
  box-sizing: inherit;
  margin: 0;
  padding: 0;
}
.zc-info-window a {
  text-decoration: none;
  transition: background-color 0.8s ease;
}
.zc-info-license-view a {
  color: #fff;
}
.zc-info-license-edit a {
  color: #333;
}
.zc-info-window-link,
.zc-info-window-activate-paid-features-link {
  text-decoration: underline !important;
}
.zc-info-license-view.zc-info-window a:hover {
  color: #ECC534;
}
.zc-info-license-edit.zc-info-window a:hover {
  color: #000;
}
.zc-text-secondary {
  color: #999 !important;
}
a.zc-text-secondary:hover {
  color: #ECC534 !important;
}
.zc-text-small {
  font-size: 12px;
}
.zc-info-window-header {
  position: relative;
}
.zc-info-window-header.zc-paid-expired,
.zc-info-window-header.zc-invalid-license,
.zc-info-window-header.zc-trial-access {
  padding: 20px 8px 0px !important;
}
.zc-info-window-page.zc-paid-expired,
.zc-info-window-page.zc-invalid-license,
.zc-info-window-page.zc-trial-access {
  padding: 5px 12px !important;
}
.zc-info-window-footer.zc-paid-expired,
.zc-info-window-footer.zc-invalid-license,
.zc-info-window-footer.zc-trial-access {
  padding: 5px 0px !important;
}
.zc-info-window-footer.zc-paid-mode {
  padding: 5px 30px !important;
}
.zc-info-window-header,
.zc-info-window-page,
.zc-info-window-footer {
  padding: 20px 30px;
}
.zc-info-license-view .zc-info-window-header {
  border-bottom: 1px solid rgba(255, 255, 255, 0.1);
}
.zc-info-license-view .zc-info-window-footer {
  border-top: 1px solid rgba(255, 255, 255, 0.1);
}
.zc-info-license-edit .zc-info-window-header {
  border-bottom: 1px solid rgba(0, 0, 0, 0.05);
}
.zc-info-license-edit .zc-info-window-footer {
  border-top: 1px solid rgba(0, 0, 0, 0.05);
}
.zc-info-window-text-center {
  text-align: center;
}
.zc-info-window-text-right {
  text-align: right;
}
.zc-clear-after {
  content: '';
  display: table;
  clear: both;
  width: 100%;
}
.zc-info-window-h1 {
  font-size: 16px;
}
.zc-info-window-h3 {
  font-size: 20.8px;
}
.zc-info-window-h4 {
  font-size: 16px;
}
.zc-info-window-h5-5 {
  /* actual default value for heading5 is 12.8, but will use 14.8 */
  font-size: 14.8px;
}
.zc-info-window-h5 {
  font-size: 12.8px;
}
.zc-info-window-license-more {
  display: none;
  color: #999;
  font-size: 14px;
}
.zc-info-window-page {
  font-size: 0;
}
.zc-info-window-page p {
  font-size: 12px;
  padding: 5px 0 10px 0;
}
.zc-info-window-page.zc-paid-expired p,
.zc-info-window-page.zc-invalid-license p,
.zc-info-window-page.zc-trial-access p {
  padding: 0 !important;
  font-size: 10px;
}
.zc-info-window-col-2 {
  display: inline-block;
  width: 50%;
  vertical-align: top;
  padding: 0 5px;
  margin: 0 10px 0 -10px;
  font-size: 12px;
}
.zc-info-window-list {
  margin: 0 0 0 26px;
  padding: 0 0 12px 0;
}
.zc-info-window-list li {
  padding: 3px 0;
  margin: 0;
}
.zc-info-window-links,
.zc-info-window-item {
  display: inline-block;
  width: 33.3%;
  vertical-align: top;
  padding: 0 5px;
  margin: 0 10px 0 -10px;
}
.zc-info-window-item-title {
  padding-bottom: 3px;
  font-size: 16px;
}
.zc-info-window-links-title {
  text-transform: uppercase;
  padding: 0 0 5px 5px;
  font-size: 12px;
}
.zc-info-window-links-link {
  display: block;
  padding: 5px;
  font-size: 12px;
}
.zc-info-window-item-image {
  display: block;
  margin: 0 auto;
  width: 55px;
  height: 55px;
  background-size: contain;
  background-repeat: no-repeat;
  margin-bottom: 5px;
}
.zc-toolbar-item-no-pointers {
  pointer-events: none !important;
}
.zc-toolbar-teim-no-image p {
  background-image: none !important;
}
