.zc-info-license-view .zc-info-window-links-link:hover {
  background: rgba(255, 255, 255, 0.1);
}
.zc-info-license-edit .zc-info-window-links-link:hover {
  background: rgba(0, 0, 0, 0.1);
}
.zc-license-info {
  position: absolute;
  top: 0;
  left: 0;
  background-color: #666;
  color: #fff;
  font-size: 11px;
  padding: 1px 3px;
  font-family: 'SegoeUI';
}
.zc-license-info a {
  color: #fff;
}
.zc-info-window-rating {
  padding-top: 5px;
}
.zc-info-window-rate {
  margin: -1px 0 0 0;
}
.zc-info-window-star {
  background-image: url('data:image/png;base64,');
  text-indent: -9999px;
  font-size: 0;
  width: 14px;
  height: 14px;
  background-size: 14px auto;
  background-position: center;
  background-repeat: no-repeat;
  display: inline-block;
  margin-top: 3px;
}
.zc-info-window-star:hover {
  transform: scale(1.2);
}
.zc-info-window-input {
  border: 1px solid;
  padding: 8px;
  margin-right: 3px;
  font-family: 'SegoeUI';
  outline: none;
}
.zc-info-window-input:focus {
  border-color: #ECC534 !important;
}
.zc-info-window-input:hover {
  border-color: #fff9ae !important;
}
.zc-info-license-view .zc-info-window-input {
  background-color: #212121;
  border-color: #000;
  color: #fff;
}
.zc-info-license-edit .zc-info-window-input {
  background-color: #EAEAEA;
  border-color: #B1B1B1;
  color: #000;
}
.zc-info-window-close {
  display: block;
  width: 40px;
  height: 40px;
  overflow: hidden;
  position: absolute;
  top: -3px;
  right: -3px;
  opacity: 0.4;
  transform: scale(0.3);
}
.zc-info-window-close:hover {
  opacity: 0.7;
  transform: scale(0.4);
}
.zc-info-window-close > div {
  position: relative;
}
.zc-info-window-close-block {
  width: 40px;
  height: 20px;
  position: relative;
  overflow: hidden;
}
.zc-info-window-close-block:before,
.zc-info-window-close-block:after {
  content: '';
  position: absolute;
  bottom: 0;
  left: calc(55% - 4px);
  display: block;
  width: 4px;
  height: 25px;
  -webkit-transform-origin: bottom center;
  transform-origin: bottom center;
  background: white;
  transition: all ease-out 280ms;
}
.zc-info-license-view .zc-info-window-close-block:before,
.zc-info-license-view .zc-info-window-close-block:after {
  background: white;
}
.zc-info-license-edit .zc-info-window-close-block:before,
.zc-info-license-edit .zc-info-window-close-block:after {
  background: black;
}
.zc-info-window-close-block:last-of-type {
  -webkit-transform: rotate(180deg);
  transform: rotate(180deg);
}
.zc-info-window-close .zc-info-window-close-in .zc-info-window-close-block:before {
  transition-delay: 280ms;
  -webkit-transform: translateX(20px) translateY(-20px) rotate(45deg);
  transform: translateX(20px) translateY(-20px) rotate(45deg);
}
.zc-info-window-close .zc-info-window-close-in .zc-info-window-close-block:after {
  transition-delay: 280ms;
  -webkit-transform: translateX(-22px) translateY(-22px) rotate(-45deg);
  transform: translateX(-22px) translateY(-22px) rotate(-45deg);
}
.zc-info-window-close .zc-info-window-close-out {
  position: absolute;
  top: 0;
  left: 0;
}
.zc-info-window-close .zc-info-window-close-out .zc-info-window-close-block:before {
  -webkit-transform: translateX(-5px) translateY(5px) rotate(45deg);
  transform: translateX(-5px) translateY(5px) rotate(45deg);
}
.zc-info-window-close .zc-info-window-close-out .zc-info-window-close-block:after {
  -webkit-transform: translateX(5px) translateY(5px) rotate(-45deg);
  transform: translateX(5px) translateY(5px) rotate(-45deg);
}
.zc-info-window-close:hover .zc-info-window-close-in .zc-info-window-close-block:before {
  -webkit-transform: translateX(-5px) translateY(5px) rotate(45deg);
  transform: translateX(-5px) translateY(5px) rotate(45deg);
}
.zc-info-window-close:hover .zc-info-window-close-in .zc-info-window-close-block:after {
  -webkit-transform: translateX(5px) translateY(5px) rotate(-45deg);
  transform: translateX(5px) translateY(5px) rotate(-45deg);
}
.zc-info-window-close:hover .zc-info-window-close-out .zc-info-window-close-block:before {
  -webkit-transform: translateX(-20px) translateY(20px) rotate(45deg);
  transform: translateX(-20px) translateY(20px) rotate(45deg);
}
.zc-info-window-close:hover .zc-info-window-close-out .zc-info-window-close-block:after {
  -webkit-transform: translateX(20px) translateY(20px) rotate(-45deg);
  transform: translateX(20px) translateY(20px) rotate(-45deg);
}
