[class*='zc-btn'] {
  padding: 9px 15px;
  text-transform: uppercase;
  font-weight: bold;
  font-size: 14px;
  position: relative;
  display: inline-block;
  margin: 5px 3px 5px 0;
  transition: background-color 0.8s ease;
}
.zc-btn-pbi-buy-now {
  /* position: initial, fixes issue with button width flicker, when hovering over X,
       happens on trial ending soon and trial ended overlays */
  position: initial;
  text-transform: none;
}
.zc-extend-trial {
  margin: 10px 0;
}
.zc-extend-trial input {
  font-size: 11px;
}
.zc-extend-trial a {
  text-transform: none;
  width: 100%;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
  vertical-align: middle;
  font-size: 11px;
}
.zc-extend-trial .zc-extend-trial-left,
.zc-extend-trial .zc-extend-trial-right {
  display: inline-block;
}
.zc-extend-trial .zc-extend-trial-left {
  width: 58%;
  padding-right: 3px;
}
.zc-extend-trial .zc-extend-trial-right {
  width: 42%;
}
.zc-extend-trial .zc-extend-trial-left .zc-info-window-input {
  width: 100%;
  vertical-align: middle;
}
.zc-btn-pbi-primary {
  color: #000 !important;
  background-color: #ECC534;
}
.zc-btn-pbi-primary:hover {
  background-color: #fad227;
}
.zc-btn-pbi-primary:focus {
  outline-style: solid;
  outline-width: 1px;
  outline-color: #000;
}
.zc-btn-pbi-secondary {
  background-color: transparent;
}
.zc-btn-pbi-primary.zc-btn-pbi-self-learning,
.zc-btn-pbi-primary.zc-btn-pbi-guided-learning,
.zc-btn-pbi-primary.zc-btn-pbi-licensing {
  width: 100px;
  text-transform: none;
  padding: 6px 15px !important;
}
.zc-info-license-view .zc-btn-pbi-primary.zc-btn-pbi-self-learning,
.zc-info-license-edit .zc-btn-pbi-primary.zc-btn-pbi-self-learning,
.zc-info-license-view .zc-btn-pbi-primary.zc-btn-pbi-guided-learning,
.zc-info-license-edit .zc-btn-pbi-primary.zc-btn-pbi-guided-learning {
  border: 1px solid #999;
  background-color: #FFF;
}
.zc-info-license-view .zc-btn-pbi-primary.zc-btn-pbi-licensing,
.zc-info-license-edit .zc-btn-pbi-primary.zc-btn-pbi-licensing {
  border: 1px solid #ECC534;
  background-color: #ECC534;
}
.zc-info-license-view .zc-btn-pbi-primary.zc-btn-pbi-self-learning:hover,
.zc-info-license-edit .zc-btn-pbi-primary.zc-btn-pbi-self-learning:hover,
.zc-info-license-view .zc-btn-pbi-primary.zc-btn-pbi-guided-learning:hover,
.zc-info-license-edit .zc-btn-pbi-primary.zc-btn-pbi-guided-learning:hover,
.zc-info-license-view .zc-btn-pbi-primary.zc-btn-pbi-licensing:hover,
.zc-info-license-edit .zc-btn-pbi-primary.zc-btn-pbi-licensing:hover {
  border: 1px solid #fad227;
  background-color: #fad227;
}
.zc-info-license-view .zc-btn-pbi-secondary {
  box-shadow: inset 0 0 0 1px rgba(255, 255, 255, 0.2);
}
.zc-info-license-edit .zc-btn-pbi-secondary {
  box-shadow: inset 0 0 0 1px rgba(0, 0, 0, 0.2);
}
.zc-info-license-view .zc-btn-pbi-secondary:hover {
  background-color: rgba(255, 255, 255, 0.1);
  color: #fff !important;
}
.zc-info-license-edit .zc-btn-pbi-secondary:hover {
  background-color: rgba(0, 0, 0, 0.1);
  color: #000 !important;
}
/* Landing page css begin */
.zc-landing-page-wrapper {
  font-size: 0;
  padding: 0;
  color: #000;
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  -ms-box-sizing: border-box;
  -o-box-sizing: border-box;
  box-sizing: border-box;
  font-family: 'SegoeUI';
  position: absolute;
  backface-visibility: hidden !important;
}
.zc-landing-page-wrapper * {
  -webkit-box-sizing: inherit;
  -moz-box-sizing: inherit;
  -ms-box-sizing: inherit;
  -o-box-sizing: inherit;
  box-sizing: inherit;
  margin: 0;
  padding: 0;
}
.zc-landing-page {
  cursor: auto;
  width: inherit;
  height: inherit;
  overflow: auto;
  padding: 5px 5px 0;
  font-size: calc(14px + 1vw);
  display: flex;
  flex-flow: column;
  -webkit-flex-flow: column;
  -moz-flex-flow: column;
  -ms-flex-flow: column;
  -o-flex-flow: column;
}
.zc-landing-page-body-wrapper {
  display: flex;
  flex-direction: column;
  -webkit-flex-direction: column;
  -moz-flex-direction: column;
  -ms-flex-direction: column;
  -o-flex-direction: column;
  justify-content: center;
  flex: 1 1 auto;
}
.zc-landing-page-body-image-wrapper {
  height: inherit;
  display: flex;
}
.zc-landing-page-header {
  margin-bottom: 5px;
  flex: 0 1 auto;
}
.zc-landing-page-footer {
  flex: 0 1 auto;
}
.zc-landing-page-link-title {
  font-size: calc(10px + 1vw) !important;
  height: auto;
  text-align: center;
  line-height: normal;
  display: block;
}
.zc-landing-page-body-left,
.zc-landing-page-body-right,
.zc-landing-page-item {
  display: inline-block;
  width: 33.3%;
  vertical-align: top;
  margin: 0 !important;
}
.zc-landing-page::-webkit-scrollbar {
  width: 5px;
  height: 5px;
}
.zc-landing-page::-webkit-scrollbar-track {
  display: none;
  border-radius: 0;
}
.zc-landing-page::-webkit-scrollbar-thumb {
  background: #ECC534;
  border-radius: 10px;
}
.zc-landing-page::-webkit-scrollbar-thumb:hover {
  background: #fff9ae;
}
.zc-landing-page-body-image {
  margin: auto;
}
.zc-landing-page-body-image img {
  display: block;
  width: 100%;
  height: 100%;
  margin: auto;
}
.zc-landing-page-logo {
  width: 100%;
  max-width: 100%;
  height: 20px;
  display: inline-block;
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center center;
}
.zc-landing-page-item-image {
  width: 100%;
  max-width: 100%;
  height: 30px;
  display: inline-block;
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center;
  margin: auto;
}
