.zc-landing-page-equal.zc-landing-page-wrapper .zc-landing-page-body-left,
.zc-landing-page-equal.zc-landing-page-wrapper .zc-landing-page-body-right,
.zc-landing-page-lesser.zc-landing-page-wrapper .zc-landing-page-body-left,
.zc-landing-page-lesser.zc-landing-page-wrapper .zc-landing-page-body-right,
.zc-landing-page-lesser.zc-landing-page-wrapper .zc-landing-page-item {
  display: block !important;
  width: 100% !important;
}
.zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item {
  padding: 12px 10px;
  display: inline-block !important;
  width: 100% !important;
}
.zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item .zc-landing-page-link-title {
  width: 75%;
  display: inline-block !important;
  padding-left: 5px;
}
.zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-body-left,
.zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-body-right {
  height: 100%;
}
.zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-body-left {
  width: 66.6% !important;
  height: 100%;
}
.zc-landing-page-equal.zc-landing-page-wrapper .zc-landing-page-body-right {
  padding: 5px 0;
}
.zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-body-right {
  height: 100%;
}
.zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item-image {
  max-width: 25%;
  height: 44px;
}
.zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item-image,
.zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-link-title {
  text-align: left;
  vertical-align: middle;
}
.zc-landing-page-lesser.zc-landing-page-wrapper .zc-landing-page-item {
  padding: 4px 10px !important;
}
.zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item-wrapper {
  padding-left: 10px;
  height: inherit;
  display: flex;
  flex-direction: column;
  -webkit-flex-direction: column;
  -moz-flex-direction: column;
  -ms-flex-direction: column;
  -o-flex-direction: column;
  justify-content: center;
}
/* Landing page css end */
@media (max-width: 480px) {
  .zc-info-window-w100,
  .zc-info-window-w10,
  .zc-info-window-w20,
  .zc-info-window-w30,
  .zc-info-window-w40,
  .zc-info-window-w50,
  .zc-info-window-w60,
  .zc-info-window-w70,
  .zc-info-window-w80,
  .zc-info-window-w90 {
    width: 100%;
  }
  .zc-info-window-text-right {
    text-align: left;
  }
  .zc-info-window-links,
  .zc-info-window-item,
  .zc-info-window-col-2 {
    display: block;
    width: 100%;
  }
  .zc-info-window-col-2 {
    padding-bottom: 0;
  }
  .zc-info-window-links-link {
    padding: 3px 5px;
    margin: 0 -5px;
  }
  .zc-info-window-links-title {
    padding: 0 0 2px 0;
  }
  .zc-info-window-rating-stars,
  .zc-info-window-rate {
    float: left;
  }
  .zc-info-window-rate {
    margin: 2px 7px 0 0;
  }
  .zc-info-window-version {
    padding-top: 4px;
  }
  .zc-info-window-list {
    padding: 0;
  }
  .zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item {
    padding: 9px 10px;
  }
  .zc-landing-page * {
    font-size: calc(10px + 1vw) !important;
  }
  .zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item-image {
    height: 34px !important;
  }
}
@media (max-width: 380px) {
  .zc-landing-page * {
    font-size: calc(8px + 1vw) !important;
  }
  .zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item {
    padding: 2px 10px;
  }
  .zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item-image {
    height: 32px !important;
  }
}
@media (max-width: 320px) {
  .zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item {
    padding: 1px 10px;
  }
  .zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page-item-image {
    height: 30px;
  }
}
@media (max-width: 280px) {
  .zc-landing-page-equal.zc-landing-page-wrapper .zc-landing-page .zc-landing-page-header span::after,
  .zc-landing-page-greater.zc-landing-page-wrapper .zc-landing-page .zc-landing-page-header span::after,
  .zc-landing-page-lesser.zc-landing-page-wrapper .zc-landing-page .zc-landing-page-header span::after {
    content: "\A";
    white-space: pre;
  }
}
@media (max-width: 240px) {
  .zc-landing-page * {
    font-size: calc(6px + 1vw) !important;
  }
  .zc-landing-page-item-image {
    height: 20px !important;
  }
}
@media (max-width: 120px) {
  .zc-landing-page * {
    font-size: calc(6px + 1vw) !important;
  }
}
/* this is important custom css for toggling editor/viewer mode */
.zc-info-license-view .zc-for-editor {
  display: none;
}
.zc-info-license-edit .zc-for-viewer {
  display: none;
}
.zc-info-window-content {
  cursor: auto;
  max-height: calc(100vh - 18px);
  overflow: auto;
}
